import logo from './Asset_10.svg';
import styled from 'styled-components'


const BG = styled.div`
background-color: #f8bc00;
font-family: 'Athiti', sans-serif;
`

class App extends Component {
  render() {
    return (
      <div>
        <BG>
          <nav class="sticky-top navbar navbar-expand-md navbar-light">
          <a href="#" class="navbar-brand">
            <img class="logo" src="Asset_10.svg"/>
            </a>
            </nav>
            okjoko
        </BG>
      </div>
        );
      }
    }
export default App
